import { getLocaleDateTimeFormat } from "@angular/common";

export enum JuegoEstatu{
    Disponible = 'Disponible',
    Vendido = 'Vendido',
    Apartado = ' Apartado',
    Negociacion = 'Negociacion'
}
export interface Videojuegos{
    id:number;
    estado: JuegoEstatu;
    imagen: string;
    notas: string;
    fecha: string;
    precioVenta: number;
    cliente: string;
    vendedor: string;
}
// <th>ID venta</th>
//                 <th>Imagen</th>
//                 <th>Producto</th>
//                 <th>Estado</th>
//                 <th>Notas</th>
//                 <th>Fecha</th>
//                 <th>Precio</th>
//                 <th>Cliente</th>
//                 <th>Vendedor</th>
